import Link from 'next/link';

const Nav =()=>(
<div>
        <Link href="/">
            <a className='home'>Home</a>
        </Link>
        <Link href="/about">
            <a className='about'>About</a>
        </Link>
        <style jsx>{`
        a{
            color: black;
            text-decoration: none;
            padding: 10px 20px;
            display: inline-block;
            background: darkcyan;
        }
        `}

        </style>
</div>
);
export default Nav;
